css:
@-moz-document url-prefix(http://putersandnet.),
url-prefix(http://www.putersandnet.) {
img[alt=Google], img[width="276"] {
  width: 0 !important;
  padding-left: 276px !important;
  height: 110px !important;
  background-image: url("data:image/gif;base64,") !important;
  margin-top: 18px !important;
}
.csb,.n div,#logo span,.ss,img[src*="/images/nav_logo3.png"]{
  background-image: url("data:image/png;base64,") !important;
}
img[src*="/images/nav_logo3.png"] {
  width: 0 !important;
  padding-left: 150px !important;
  height: 105px !important;
}
#gbi {
  background: #001100 !important;
  border:1px solid;border-color: #003300 !important;
}
#gbar .gb2 a:hover {
  background: #003300 !important;
  text-decoration: none !important;
}
.gbh,.gb2 div {
  border-top: 1px solid #003300 !important;
}
.t {
  background: #001100 !important;
}
.bb {
  border-bottom: 1px solid #003300 !important;
}
.bt {
  border-top: 1px solid #003300 !important;
}
body {
  background: #000000 !important;
  background-image: url("data:image/png;base64,") !important;
  background-repeat: repeat-x !important;
  color: #00b200 !important;
}
a {
  color: #00b277 !important;
  text-decoration: none !important;
}
a:hover {
  color: #006600 !important;
  text-decoration: underline !important;
}
.gb1 {
  color: #008800 !important;
}
input[type=submit] {
  background: #002200 !important;
  border-color: #001100 !important;
  border-width: 1px !important;
  border-style: solid !important;
  color: #008800 !important;
  -moz-border-radius: 5px;
}
input[type=submit]:hover {
  background: #001100 !important;
  border-color: #002200 !important;
  color: #006600;
}
input[name=q] {
  background: #001100 !important;
  border-color: #003300 !important;
  border-width: 1px !important;
  border-style: solid !important;
  color: #00b200 !important;
  -moz-border-radius: 5px;
}
#gbh {
  background-color: #005500 !important;
}
div#res {
  margin-top: 10px !important;
  padding: 10px !important;
}
div#res {
  color: #00b200 !important;
  background: #000800 !important;
  border-top-color: #002200 !important;
  border-left-color: #002200 !important;
  border-right-color: #001800 !important;
  border-bottom-color: #001800 !important;
  border-width: 4px !important;
  border-style: double !important;
  -moz-border-radius: 20px;
}
div#res .std {
  color: #00b200 !important;
}
div#res .a {
  color: #006633 !important;
}
div#res b {
  color: #00ee00 !important;
}
div#res a:visited {
  color: #006633 !important;
}
#res #navbar a {
  color: #c09a03 !important;
}
div,td,.n a,.n a:visited {
  color:#008800 !important
}
#navbar {
  background: #000000 !important;
  border-top-color: #001800 !important;
  border-left-color: #001800 !important;
  border-right-color: #002200 !important;
  border-bottom-color: #002200 !important;
  border-width: 2px !important;
  border-style: solid !important;
  -moz-border-radius: 10px;
}
}
